  <style>

	:root {
      --black: rgb(48,48,48);
		--fonttext: Futura,Trebuchet MS,Arial,sans-serif;

    #us-map {
      display: block;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
	   fill: (red);
	   stroke: whitesmoke;
	   stroke-width: 0px;
	   padding: auto auto auto auto;
      opacity: 1;
      animation-name: img;
      animation-duration: 2s;
	}

   @keyframes img {
      from {opacity: 0;}
      to {opacity: 1;}
   }

   path:hover {
      stroke: var(--black);
      stroke-width:2px;
      stroke-linejoin: round;
      fill: var(--black);
	  transition: 0.2s;
    }

   h5 {
      border-bottom-style: solid;
      border-color: red;
      border-width: 2px;
      margin-bottom: 20px;
      margin-left: 100px;
      margin-right: 100px;
      animation-name: underline;
      animation-duration: 1s;
      animation-timing-function: ease-out;
  }

  @keyframes underline {
      from {transform: scaleX(0);}
      to {transform: scaleX(1);}
  }

	path {
		fill: red;
	}

    #info-box {
      opacity: 0;
      position: static;
      top: 0px;
      left: 0px;
      z-index: 1;
      background-color: whitesmoke;
      border: .5px solid var(--black);
      border-radius: 10px;
      padding: 10px;
      font-family: var(--fonttext);
	   color: var(--black);
      transition: 0.6s;
      margin-left: 600px;
      font-family: var(--fonttext);
    }

	div {
		text-align: center;
	}

   #title {
      font-weight: bold;
   }
